"""# Way to Grandline (Predict Episodes for New Arcs)"""

import tensorflow as tf
from sklearn.preprocessing import MinMaxScaler
from tensorflow import keras
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import LSTM, Dense

# Normalize episode counts
scaler = MinMaxScaler()
OP_arcs['normalized_episode_count'] = scaler.fit_transform(OP_arcs['TotalEpisodes'].values.reshape(-1, 1))
OP_arcs['normalized_manga_chapters'] = scaler.fit_transform(OP_arcs['TotalChapters'].values.reshape(-1, 1))

# Feature Engineering
# Assuming you have additional features like cumulative episode count, duration, etc.
features = ['TotalMinutes(avg 24)', 'normalized_manga_chapters']
X = OP_arcs[features].values
y = OP_arcs['normalized_episode_count'].values

tf.config.run_functions_eagerly(True)  # Enable eager execution

input_shape = (1, len(features))

# Reshape input data to match expected shape of the model
X = X.reshape(X.shape[0], 1, X.shape[1])

# Step 4: Model Training
model = Sequential()
model.add(LSTM(50, activation='relu', input_shape=(None, X.shape[2]), return_sequences=True))
model.add(LSTM(50, activation='relu'))
model.add(Dense(1))
model.compile(optimizer='adam', loss='mean_squared_error')
model.fit(X, y, epochs=100, batch_size=16)

# Compile the model with eager execution
model.compile(optimizer='adam', loss='mean_squared_error', run_eagerly=True)

# Enable eager execution explicitly
tf.config.run_functions_eagerly(True)

# Step 5: Future Arc Prediction
manga_chapters = 20

# Create a new instance with the fixed manga chapters
new_instance = np.array([[0, manga_chapters]])
new_instance[:, -1] = scaler.transform(new_instance[:, -1].reshape(-1, 1))

# Reshape the new instance for prediction
new_instance = new_instance.reshape(new_instance.shape[0], 1, new_instance.shape[1])

# Make a prediction for the future arc
predicted_episode_count = model.predict(new_instance)
predicted_episode_count = scaler.inverse_transform(predicted_episode_count)[0][0]

print(f"Predicted episode count for the future arc: {predicted_episode_count:.0f}")